Defendant Frankie L Bowlin in court, in custody, with attorney M. Elizabeth Weathers.   Timothy F. Westphal appeared for the State of Wisconsin.
Plea Colloquy.
  Defendant enters a guilty plea to Count 1.  Court finds defendant guilty. Counts 2 through 5 are dismissed and read in.

The Court Orders the Following:

Imposed and Stayed Sentence of:

38 months  Imprisonment (Credit - 125 days )
- 14 months  of Initial Confinement
- 24 months  of Extended Supervision

Term of Probation: 3 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time employment;
- No contact with  Pick N Save in Brookfield on Greenfield Avenue.
- Provide DNA sample if not yet provided  and pay surcharge.

Costs: $268.00 
DNA Surcharge:  $250.00
(To be paid as a condition of probation at the rate of $50.00  per month commencing 6-1-15)

Defendant is not eligible for the Challenge Incarceration Program
Defendant is not eligible for the Substance Abuse Program

Expunction is conditionally granted upon completion of sentence, payment of all costs/fees and no new criminal law violations ( Current Milwaukee County case is exempt).  Defendant must Petition the Court in writing upon successful completion of the sentence.
